import React from 'react';
import Entrance from "./pages/entrance";
import "./App.css";

import { BrowserRouter as Router, Routes, Route }
    from 'react-router-dom';

function App() {

    return (
      <Router>
        <Routes>
          <Route exact path="/entrance" element={Entrance} />
        </Routes>
      </Router>
    );
}

export default App;
